        filepath_fullvbgaiappname = bpy.path.abspath(mytool.my_stringappname)
        filepath_fullvbgaiapikey = read_api_key(api_key_file_path)
        
        if not filepath_fullvbgaiapikey:
            print("Failed to read API key. Aborting operation.")
            return {'CANCELLED'}
